// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Capped.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./interfaces/ISkullsRising.sol";

contract YieldToken is ERC20Capped, Ownable, AccessControl {
	using SafeMath for uint256;

	// read ether = tokens
	uint256 public LOW_RATE = 10 ether;
	uint256 public MEDIUM_RATE = 15 ether;
	uint256 public HIGH_RATE = 20 ether;

	// Tue Mar 18 2031 17:46:47 GMT+0000
	uint256 constant public END = 1931622407;

	mapping(address => uint256) public rewards;
	mapping(address => uint256) public lastUpdate;

	ISkullsRising public skullsContract;

	event RewardPaid(address indexed user, uint256 reward);

	bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
	bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");

	modifier onlyMinter() {
		require(hasRole(MINTER_ROLE, _msgSender()), "AccessControl: caller is not the minter");
		_;
	}

	modifier onlyBurner() {
		require(hasRole(BURNER_ROLE, _msgSender()), "AccessControl: caller is not the burner");
		_;
	}

	constructor (
		address _skulls,
		uint256 _supplyCap
	) ERC20("Bones", "BONES") ERC20Capped(_supplyCap)
	{
		_setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
		skullsContract = ISkullsRising(_skulls);
	}

	function min(uint256 a, uint256 b) internal pure returns (uint256) {
		return a < b ? a : b;
	}

	function getTime() public virtual view returns (uint256) {
		return block.timestamp;
	}

	function getDailyRewardRate(uint256 _tokenId) public view returns (uint256) {
		uint256 rarity = skullsContract.getRarity(_tokenId);

		if (rarity <= 500) {
			return HIGH_RATE;
		} else if (rarity <= 3000) {
			return MEDIUM_RATE;
		} else {
			return LOW_RATE;
		}
	}

	// called on transfers
	function updateReward(address _from, address _to, uint256 _tokenId) external {
		require(msg.sender == address(skullsContract));
		if (_tokenId <= 4000) {
			uint256 time = min(getTime(), END);
			uint256 timerFrom = lastUpdate[_from];
			if (timerFrom > 0)
				rewards[_from] = rewards[_from].add(getPendingRewards(_from, timerFrom));
			if (timerFrom != END)
				lastUpdate[_from] = time;
			if (_to != address(0)) {
				uint256 timerTo = lastUpdate[_to];
				if (timerTo > 0)
					rewards[_to] = rewards[_to].add(getPendingRewards(_to, timerTo));
				if (timerTo != END)
					lastUpdate[_to] = time;
			}
		}
	}

	function getReward(address _to) external {
		require(msg.sender == address(skullsContract));
		uint256 reward = rewards[_to];
		if (reward > 0) {
			rewards[_to] = 0;
			_mint(_to, reward);
			emit RewardPaid(_to, reward);
		}
	}

	function getPendingRewards(address _user, uint256 _lastUpdateTime) internal view returns (uint256) {
		uint256 pending = 0;
		uint256 time = min(getTime(), END);
		// Iterate through all tokens owner by user.
		for (uint256 i = 0; i < skullsContract.balanceOG(_user); i++) {
			uint256 tokenId = skullsContract.tokenOfOwnerByIndex(_user, i);
			pending = pending.add(getDailyRewardRate(tokenId).mul(time.sub(_lastUpdateTime)).div(86400));
		}

		return pending;
	}

	function getTotalClaimable(address _user) external view returns(uint256) {
		return rewards[_user].add(getPendingRewards(_user, lastUpdate[_user]));
	}

	/*
	* OWNER FUNCTIONS
	*/

	/**
	 * @dev Remember that only owner can call so be careful when use on contracts generated from other contracts.
	 * @param _tokenAddress The token contract address
	 * @param _tokenAmount Number of tokens to be sent
	 */
	function recoverERC20(address _tokenAddress, uint256 _tokenAmount) public onlyOwner {
		IERC20(_tokenAddress).transfer(owner(), _tokenAmount);
	}

	function mint(address _account, uint256 _amount) public onlyMinter {
		_mint(_account, _amount);
	}

	function burn(address _from, uint256 _amount) external onlyBurner {
		_burn(_from, _amount);
	}
}

